 these ontologies, you can click on one of them, which will enable step 2b.<br><br><\/p><p><b>Add ontology:<\/b> Here, you need to provide a unique name for the new ontology. The new ontology will not contain any elements. To add elements create an ontology, choose it from the overview on the left-hand side and open <i>Step 2b: Edit ontology<\/i>.<br><br><\/p><p><b>Delete ontology:<\/b> If you want to delete an existing ontology, just choose it from the list. However, if you delete an ontology which is used by one or multiple templates, these templates and all maps that are based on these templates will be deleted as well. Use this option with care!<\/p>',Aof='<p><b>Description:<\/b> In this step, you will be able to edit the elements of the chosen ontology. There is an overview of nodes and relations of the ontology on the left-hand side ("Elements of this ontology"), whereas a preview of the currently selected element is shown on the right-hand side. The actions that can be done are shown in the bottom area in this step. Please consult the manual for further instructions.<br><br><\/p>',Pmf='<p><b>Description:<\/b> Once the ontology and template is defined, you have here the possibility to create concrete instances of an argument map. On the left-hand side, there is an overview of all existing maps (pre-defined as well as user-created ones) sorted by template. On the right-hand side, you can choose if you want to add or delete a map.<br><br><\/p><p><b>Add map:<\/b> To add a new map, you have to choose a template on which the map is based on. Further, each map requires a unique name, which will appear in the map overview after login. Optionally, you can restrict a map to a single user (this of course does only makes sense, if you do not plan to argue collaboratively in this map). To restrict a map to a specific user, choose one from the list. Otherwise leave the field emptry to make it accessible for all users of the system. If you do not want to create pre-defined , it is important to know that it is only possible to relate an element to a complete line (or multiple lines) but not to single words or parts of a transcript line.<\/p><p>In addition to these specific options, there is a set of general options. Here, you have to choose on which ontology the template is based as well as a unique and a (optional) description which appears during login in the details of the map.<br><br><\/p><p><b>Delete template:<\/b> If you want to delete an existing template, just choose it from the list. If this template is used by one or more map, these maps will be deleted as well and not restoreable!<\/p>',dAf='<pre>',vTe='<span  unselectable=on class="x-tree3-node-text">',$Se='<span class="x-tree3-node-check"><\/span>',aTe='<span class="x-tree3-node-icon"><\/span>',LMe="<span class='x-tab-strip-inner' role='presentation'><span class='x-tab-strip-text {textStyle} {iconStyle}'>{text}<\/span><\/span>",tqf='<span style="color: #000000;">Blue<\/span>',Gqf='<span style="color: #000000;">Dashed<\/span>',Eqf='<span style="color: #000000;">Double<\/span>',apf='<span style="color: #000000;">Editable<\/span>',Ipf='<span style="color: #000000;">First<\/span>',sqf='<span style="color: #000000;">Green<\/span>',Apf='<span style="color: #000000;">Label',bpf='<span style="color: #000000;">Non-Editable<\/span>',Cpf='<span style="color: #000000;">Option1<\/span>',Epf='<span style="color: #000000;">Option2<\/span>',Gpf='<span style="color: #000000;">Option3<\/span>',qqf='<span style="color: #000000;">Orange<\/span>',zqf='<span style="color: #000000;">Other... <\/span>(<span style="color: ',uqf='<span style="color: #000000;">Other...<\/span>',pqf='<span style="color: #000000;">Red<\/span>',Fqf='<span style="color: #000000;">Round Edges<\/span>',Jpf='<span style="color: #000000;">Second<\/span>',Cqf='<span style="color: #000000;">Standard<\/span>',Kpf='<span style="color: #000000;">Third<\/span>',rqf='<span style="color: #000000;">Yellow<\/span>',Dqf='<span style="
